	add("torsion", "{\"term\":\"torsion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French from \u0027torsio\u0027, from Latin \u0027torqueō\u0027 (twist, turn) See \u0027\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of turning or twisting, or the state of being twisted; the twisting or wrenching of a body by the exertion of a lateral force tending to turn one end or part of it about a longitudinal axis, while the other is held fast or turned in the opposite direction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That force with which a thread, wire, or rod of any material, returns, or tends to return, to a state of rest after it has been twisted; torsibility.\u0026lt;!-- from webster:Torsion (Page: 1520)Tor\u0026quot;sion (?), n. [F., fr. LL. torsio, fr. L. torquere, tortum, to twist. See Torture.]1. The act of turning or twisting, or the state of being twisted; the twisting or wrenching of a body by the exertion of a lateral force tending to turn one end or part of it about a longitudinal axis, while the other is held fast or turned in the opposite direction.2. (Mech.) That force with which a thread, wire, or rod of any material, returns, or tends to return, to a state of rest after it has been twisted; torsibility. Angle of torsion (of a curve) (Geom.), the indefinitely small angle between two consecutive osculating planes of a curve of double curvature. -- Moment of torsion (Mech.) the moment of a pair of equal and opposite couples which tend to twist a body. -- Torsion balance (Physics.), an instrument for estimating very minute forces, as electric or magnetic attractions and repulsions, by the torsion of a very slender wire or fiber having at its lower extremity a horizontal bar or needle, upon which the forces act. -- Torsion scale, a scale for weighing in which the fulcra of the levers or beams are strained wires or strips acting by torsion.--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("torsionmeter", "{\"term\":\"torsionmeter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|torsion|meter|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instrument for determining the torque on a shaft, and hence the horsepower of an engine, by measuring the amount of twist of a given length of the shaft\", \"priority\":1}]}, \"synonyms\":{}}");

	add("tortfeasance", "{\"term\":\"tortfeasance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|tortfesance}}, from Old french (842-ca. 1400) \u0027tort\u0027 (wrong) \u0027fesance\u0027 (action, deed, enactment)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition, or an act of doing wrong\", \"priority\":1}]}, \"synonyms\":{}}");

