	add("tortilla", "{\"term\":\"tortilla\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|es|lang\u003den}} (Mexican) \u0027tortilla\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat round bread made out of cornmeal or flour. In Mexican cuisine they are often served with a filling or topping such as \u0027frijoles\u0027 \u0026quot;beans\u0026quot;, \u0027carne\u0027 \u0026quot;meat\u0026quot;, \u0027salsa\u0027 \u0026quot;sauce\u0026quot;, sour cream and cheese, in which case they are called quesadillas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Spanish omelette; an omelette containing potatoes and onions\", \"priority\":2}]}, \"synonyms\":{}}");

