	add("tortoise", "{\"term\":\"tortoise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027tortuse\u0027 \u0027tortuce\u0027 \u0027tortuge\u0027 from \u0027tortuca\u0027 possibly from \u0027tartarūcha\u0027 from \u0027tartarūchus\u0027 (of tartarus) from Ancient greek (to 1453) \u0027ταρταροῦχος\u0027 (lang\u003dgrc) because it used to be thought that tortoises and turtles came from the underworld; or from Latin \u0027tortus\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various land-dwelling reptiles, of family \u0027Testudinidae\u0027, whose body is enclosed in a shell (carapace plus plastron). The animal can withdraw its head and four legs partially into the shell, providing some protection from predators\", \"priority\":1}]}, \"synonyms\":{}}");

	add("tortoiseshell", "{\"term\":\"tortoiseshell\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|tortoise|shell|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The horny, translucent, mottled covering of the carapace of the hawksbill turtle, used as a veneer etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The hawksbill turtle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A domestic cat whose fur has black, brown and yellow markings\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of several butterflies, mostly of the genus that have similar markings\", \"priority\":4}]}, \"synonyms\":{}}");

