	add("torturee", "{\"term\":\"torturee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|torture|ee|lang\u003den}}, after \u0027torturer\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is subjected to torture; a torture victim\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Mirko Bagaric and Julie Clarke, \u0027Torture: When the Unthinkable is Morally Permissible\u0027, w:Albany, New Albany: , ISBN 9780791471531 (hardcover), ISBN 9780791471548 (paperback), [http://books.google.co.uk/books?id\u003dG22YNHpUWXUC\u0026amp;pg\u003dPA37\u0026amp;dq\u003d%22torturees%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003du3meUdPEFqnM0QXu9IG4Dg\u0026amp;ved\u003d0CF0Q6AEwC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22torturees%22\u0026amp;f\u003dfalse page 37\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Regardless of the guilt of the agent, it is most important that torture is only used against individuals who actually possess the relevant information. It will be rare that conclusive proof is available that an individual does, in fact, possess the required knowledge; for example, potential \u0027\u0027torturees\u0027\u0027 will not have been through a trial process in which their guilt has been established\", \"priority\":4}]}, \"synonyms\":{}}");

